import React, {useState, useEffect} from 'react';
import { getCourses } from '../components/utils/fetchs';
import { ListSubheader, List, ListItemButton, ListItemIcon, ListItemText, Collapse, InboxIcon, DraftsIcon, SendIcon, ExpandLess, ExpandMore, StarBorder} from '@mui/icons-material';


const MyCourse = () => {

    const [courses, setCourses] = useState([])
    const [open, setOpen] = React.useState(true);

    const handleClick = () => {
        setOpen(!open);
    };
    useEffect(()=> {
        const fetchCourses = async() => {
            let response = await getCourses()
            console.log(response)
            setCourses(response)
        }
        fetchCourses()
    }, [])
    return ( 
        <List
            sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}
            component="nav"
            aria-labelledby="nested-list-subheader"
            subheader={
                <ListSubheader component="div" id="nested-list-subheader">
                Nested List Items
                </ListSubheader>
            }
            >
            <ListItemButton>
                <ListItemIcon>
                <SendIcon />
                </ListItemIcon>
                <ListItemText primary="Sent mail" />
            </ListItemButton>
            <ListItemButton>
                <ListItemIcon>
                <DraftsIcon />
                </ListItemIcon>
                <ListItemText primary="Drafts" />
            </ListItemButton>
            <ListItemButton onClick={handleClick}>
                <ListItemIcon>
                <InboxIcon />
                </ListItemIcon>
                <ListItemText primary="Inbox" />
                {open ? <ExpandLess /> : <ExpandMore />}
            </ListItemButton>
            <Collapse in={open} timeout="auto" unmountOnExit>
                <List component="div" disablePadding>
                <ListItemButton sx={{ pl: 4 }}>
                    <ListItemIcon>
                    <StarBorder />
                    </ListItemIcon>
                    <ListItemText primary="Starred" />
                </ListItemButton>
                </List>
            </Collapse>
            </List>
    );
}

export default MyCourse;
